<app-navbar></app-navbar>
<div class="mainContainer">
    <!-- Top Info -->
    <div class="topInfo">
            <div class="propertyTypeIcon">
                    <i class="large city icon" style="color:white;"></i>
            </div>
            <div style="flex:1 0 auto;">
                <!-- <div style="font-weight: bold;font-size:18px;">{{projectSelected.project_name}}</div>
                <div style="font-size:12px;">{{projectSelected.project_name}}, {{projectSelected.state}} {{projectSelected.zipcode}}</div>
                <div style="font-size:12px;">Status: <span style="border-bottom: 1px dotted ;">Active</span>&nbsp;
                    <div class="ui blue rating" data-rating="4" data-max-rating="5"></div>
                </div> -->
            </div>
            <span (click)="save($event)" class="actionButton"><i class="like outline blue icon"></i>{{saveText}}</span>
            <span (click)="share()" class="actionButton"><i class="external alternate icon"></i>Share</span>
            <!-- <button routerLink="/buy" class="ui blue button cartButton"><i class="shopping cart icon"></i><span *ngIf="plotCart.length>0">{{plotCart.length}}</span></button> -->
          
        </div>
        <hr style="opacity: 0.3;">
        <div class="gridContainer">
            <div class="flexActions">
                <div>
                        <button (click)="selectPlan1($event)" class="ui yellow tiny button basic selectedPlan">Plan 1</button>
                        <!-- <button (click)="selectPlan2($event)" class="ui basic yellow button">Plan 2</button>
                        <button (click)="selectPlan3($event)" class="ui basic yellow button">Plan 3</button> -->
                </div>
                <div class="plotStatus">
                        <div class="ui green label" style="width:40px;text-align: center">351</div><div style="font-size:14px;font-weight: bold;padding:2px 0;"> Available</div>
                        <div class="ui blue label" style="width:40px;text-align: center">0</div><div style="font-size:14px;font-weight: bold;padding:2px 0;"> Partially Available</div>
                        <div class="ui red label" style="width:40px;text-align: center">0</div><div style="font-size:14px;font-weight: bold;padding:2px 0;"> Sold</div>
                </div>
                <div class="ui icon input searchPlot">
                        <i class="search icon"></i>
                        <input (ngModelChange)="modelChange($event)" (keyup.enter)="searchPlot($event)" [(ngModel)]="plotNumber" type="number" placeholder="Search By Plot Number">
                </div>
                <div  class="ui  action input searchPlotDesktop">

                        <div  class="ui blue extraText button">Select by Plot Number</div>
                </div>
